import React from 'react'

import "./Head.css"

export function Head() {

  return (
    <nav className="head">
       <Link to="/" className="headLink"><h1>Bioprep</h1></Link>
        <ul className= "menu">
            <li>Inicio</li>
            <li>Productos</li>
            <li>Nosotros</li>
            <li>Contacto</li>
            <br></br>
        </ul>
    </nav>
  );
}

export default Head;
